import React from "react";
import { NavLink } from "react-router-dom";

const Login = () => {
    return (
        <div>
            <div className="container shadow my-5">
                <div className="row">
                    <div className="col-md-5 d-flex flex-column align-items-center form">
                        <h1 className="display-4 fw-bolder text-white">They always come back</h1>
                        <p className="lead text-center text-white">Enter your email and password to Login</p>
                        <h5 className="mb-4 text-white">OR</h5>
                        <NavLink to="/register" className="btn btn-outline-light 
                        ounded-pull mb-2 w-50">Sign Up</NavLink>
                    </div>
                </div>
            </div>
        </div>

    );
};

export default Login;
